function rotateArray(arr, k) {
  const n = arr.length;
  k %= n; 

  for (let i = 0; i < n; i++) {
      if (i >= k) {
          const temp = arr[i - k];
          arr[i - k] = arr[i];
          arr[i] = temp;
      }
  }

  return arr;
}

