  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const strArray = `
function fun() {
  const arr1 = [1, 5, 10, 20, 40, 80];
  const arr2 = [6, 7, 20, 80, 100];
  const arr3 = [3, 4, 15, 20, 30, 70, 80, 120];
  let result = [];
  let i = 0, j = 0, k = 0;

  while (i < arr1.length && j < arr2.length && k < arr3.length) {
      if (arr1[i] === arr2[j] && arr2[j] === arr3[k]) {
          result.push(arr1[i]);
          i++;
          j++;
          k++;
      } else if (arr1[i] < arr2[j]) {
          i++;
      } else if (arr2[j] < arr3[k]) {
          j++;
      } else {
          k++;
      }
  }

  console.log(result);  
}


fun()
`.trim();

const Sort = `
let i, j, arr=[0,9,8,7,6];
var max=0;

for(i=0; i<arr.length; i++){
  for(j=i; j<arr.length; j++){
    if(arr[i]>arr[j]){
      var temp=arr[i];
      arr[i]=arr[j];
      arr[j]=temp;
    }
  }
}

console.log(arr);


//Greatest Product Of 3
max = arr[arr.length-1] * arr[arr.length-2] * arr[arr.length-3]
console.log(max);


//optimsed
const arr = [0, 9, 8, 7, 6];
arr.sort((a, b) => a - b);

console.log(arr);
`.trim()

const duplicates = `
function removeDup(){
  const arr = [1,2,3,4,3,0,9,0,1];
  const result=[];

  for(let i=0; i<arr.length;i++){
      let count=0;
     // for(let j=0;j<result.length;j++){
        for(let j=0;j<arr.length;j++){                                     //Remove Duplicates
       // if(arr[i]==result[j]) count +=1;                                 //Unique Character
          if(arr[i]==arr[j]) count +=1;
      }
      if(count==1){                                                      //RD
   // if(count==0){                                                      //UC
          result.push(arr[i]);
      }  
  }

  console.log(result)
}

removeDup();
`.trim()

const compare_array = `
function compare(){
  const arr=[1,2,3,4,5,6];
  const arr2=[5,6,7,8,9,0];
  const result=[];

  for(let i=0; i<arr.length; i++){
    if(arr2.indexOf(arr[i]) !== -1){
      result.push(arr[i]);
    }
  }
  console.log(result)
}

compare();


//Unique name
function getUnique(){
  var names = ["John", "Peter", "Clark", "Harry", "John", "Alice"];
  var newName = [];

  for(i=0; i < names.length; i++){
      if(newName.indexOf(names[i]) === -1) {
          newName.push(names[i]);
      }
  }
  console.log(newName);
}

getUnique();
`.trim();

const findMedianSortedArrays = `
const median = () => {
  const arr = [1,12,15,26,38];
  const arr2 = [4,3,1];
  let arrMedian=[];

  const result = [...arr, ...arr2].sort((a, b) => a - b);
  const half = result.length / 2 | 0;

  if (result.length % 2){
      arrMedian=result[half];
  }
  else{
      arrMedian=((result[half] + result[half-1])/2);
  }
  return console.log(arrMedian);
}

median()
`.trim();

const plusOne = `
function plusOne(){
  const arr=[1,2,3];
  let result=[], result2=[];

  for(let i=0; i<arr.length; i++){
    result.push(arr[i]);
    result2 = arr[arr.length-1]+1
  }

  result.pop();
  result.push(result2);
  console.log(result)
}

plusOne();
`.trim();

const bulb = `function fun() {
  let n = 4;
  let result = [];

  for (let i = 0; i <= n; i++) {
      let roundOnCount = 0;

      for (let j = 1; j <= i; j++) {
          if (i % j === 0) {
              roundOnCount++;
          }
      }

      result[i] = roundOnCount % 2 === 1;
  }

  let count = 0;
  for (const bulb of result) {
      if (bulb) {
          count++;
      }
  }

  return count;
}

console.log(fun());  
`.trim();

const rotateArray = `
function rotateArray(arr, k) {
  const n = arr.length;
  k %= n; 

  for (let i = 0; i < n; i++) {
      if (i >= k) {
          const temp = arr[i - k];
          arr[i - k] = arr[i];
          arr[i] = temp;
      }
  }

  return arr;
}

const arr = [1, 2, 3, 4, 5];
const k = 2;
rotateArray(arr, k);
console.log(arr); // Output: [4, 5, 1, 2, 3]
`.trim();

const countInversions = `

function countInversions(arr) {
  const n = arr.length;
  let count = 0;

  for (let i = 0; i < n; i++) {
      for (let j = i + 1; j < n; j++) {
          if (arr[i] > arr[j]) {
              count++;
          }
      }
  }

  return count;
}

const arr = [4, 3, 1, 2];
const result = countInversions(arr);
console.log(result);  // Output: 5`.trim();

const cyclicShiftLeft = `
function cyclicShiftLeft(arr, k) {
  const n = arr.length;
  k %= n;                                     // In case k is larger than array length

  for (let i = 0; i < n; i++) {
      const newIndex = (i + n - k) % n;
      console.log(arr[newIndex]);
  }
}

const arr = [1, 2, 3, 4, 5];
const k = 2;
cyclicShiftLeft(arr, k);
`.trim();

const unluckyNo = `
function fun() {
  const n = 1000;
  const arr = [];

  // Fill the arr array with random numbers between 0 and 99
  for (let i = 0; i < n; i++) {
      arr.push(Math.floor(Math.random() * 100));
  }

  let count = 0;

  for (let i = 0; i < n; i++) {
      if (arr[i] !== 13) {
          count++;
      }
  }

  console.log(count);
}

fun();
`.trim();

const countNiceStrings = ``.trim();

const arrayCounter = `
function fun(arr) {
  let maxDepth = 0;
  let stack = arr.map(element => ({ nestedArr: element, depth: 1 }));

  while (stack.length > 0) {
    const { nestedArr, depth } = stack.pop();

    if (!Array.isArray(nestedArr)) {
      maxDepth = Math.max(maxDepth, depth); // If it's not an array, it's the end of a branch
    } else {
      for (const element of nestedArr) { //push its elements to the stack with increased depth
        stack.push({ nestedArr: element, depth: depth + 1 });
      }
    }
  }

  console.log(maxDepth);
}

fun([[3]]);
fun([[[[[[[9]]]]]]]); 
fun([]); 
`.trim()

const countElements = `
function fun() {
  const nums = [-7, -3, 2, 3, 11];
  const n = nums.length;
  let left = 0;
  let right = n - 1;
  const result = [n]

  for (let index = n - 1; index >= 0; index--) {
      const leftSquare = nums[left] ** 2;
      const rightSquare = nums[right] ** 2;

      if (leftSquare > rightSquare) {
          result[index] = leftSquare;
          left++;
      } else {
          result[index] = rightSquare;
          right--;
      }
  }

  return console.log(result);  
}

fun()
`.trim();

const occurings = `
function fun() {
  const arr = [1, 2, 3, 4, 5, 6, 1, 2, 1, 3];
  const hash = {};

  for (let i = 0; i < arr.length; i++) {
    if (hash[arr[i]]) {
      hash[arr[i]] += 1;
    } else {
      hash[arr[i]] = 1;
    }
  }

console.log(hash);
}

fun();`.trim();

const find132pattern = `
function pattern123() {
  const arr=[1,2,3,4];
  const number = 132;
  const result=[];

  const target = number.toString();
  [target]

  for(let i=0; i<arr.length; i++){
    if(target.indexOf(arr[i]) !== -1){
      result.push(arr[i]);
    }
  }
  console.log(result)
}

pattern123();
`.trim();

const numIdenticalPairs = `
function fun(){
  const arr=[1,2,3,1,1,3];
  const result=[];
  let count=0;

  for(let i=0; i<arr.length; i++){
    for(let j=i+1; j<arr.length; j++){
      if(arr[i]==arr[j]){
        result.push([arr[i], arr[j]]);
        count++;
      }
    }
  }
  console.log(result)
  console.log(count)
}

fun();
`.trim();

const removeElement = `
function fun(){
  const arr=[1,2,3,5,4];
  const num=5;

  const index = arr.indexOf(num);
  arr.splice(index,1)
  console.log(arr)
}

fun();
`.trim();

const shuffle = `
function fun(){
  const arr = [7,8,9,10];

  for(let i=0;i<arr.length;i++){
    const j = Math.floor(Math.random() * (i + 1));
    let temp = arr[i];
    arr[i] = arr[j];
    arr[j] = temp;
  }
  console.log(arr);
}

fun();
`.trim();

const searchRange = `
function fun() {
  const nums = [5, 7, 7, 8, 8, 10];
  const target = 8;
  const result = [];

  for (let i = 0; i < nums.length; i++) {                  // Find the first occurrence
      if (nums[i] === target) {
          result[0] = i;
          break;
      }
  }

  for (let i = nums.length - 1; i >= 0; i--) {             // Find the last occurrence
      if (nums[i] === target) {
          result[1] = i;
          break;
      }
  }

  return result;
}

console.log(fun());  
`.trim();

const combinationSum = `
function combinationSum(){
  const arr=[1,2,3,6,4,5];
  const target = 7;
  let result=[];

  for(let i=0; i<arr.length; i++){
    for(let j=i; j<arr.length; j++){
      if(arr[i]+arr[j]==target){
        result.push(arr[i],arr[j])
      }
    }
  }  
  console.log(result);
}

combinationSum();
`.trim();

const missing_number = `
function missNum() {
  let i, arr=[0,1,2,4,5], exactsum=0, result=0;
  exactsum = arr.reduce((a, b) => a + b);

  for (i=0; i<=arr.length; i++) {
    result += i
  }

  result -= exactsum;
  console.log('Missing Number', result)
}

missNum();
 `.trim()

const findMissingRanges = `
const arr = [1,2,4,8];
const missing = [];
var count = 1;

for (let i=0; i<arr.length; i++) {
  if (arr[i] !== count) {
    missing.push(count);
    i--;
  }
  count++;
}

console.log(missing);
`.trim();

const sortname = `
var objs = [ 
  { first: 'Mukesh', last: 'Jamf' },
  { first: 'Rakesh', last: 'Bodine' },
  { first: 'Bicky', last: 'Prentice' }
];

function fun(){
  for(let i=0;i<objs.length;i++){
