        let temp=objs[i];
        objs[i]=objs[j];
        objs[j]=temp;
      }
    }
    console.log(objs[i])
  }
}

fun()

//2
function compare(a, b) {
  if (a.first < b.first){
    return -1;
  }
  if (a.first > b.first){
    return 1;
  }
  return 0;
}

const obj = objs.sort(compare);
console.log(obj)
`.trim();

const concatarr = `
const arr1 =[{id:1,name:"sai"}, {id:2,name: "King"}];
const arr2 = [{id:1,age:23},{id:2,age:24}];

function fun(){
   const result = arr1[0].name.concat(arr2[1].age);
   console.log(result)
}

fun();
`.trim();

const permute = `
function fun() {
  const nums = [2, 3, 1, 1, 4];
  let maxReach = 0;

  for (let i = 0; i < nums.length; i++) {
      if (i > maxReach) {
          return false;                          // If we can't reach the current index
      }

      maxReach = Math.max(maxReach, i + nums[i]);

      if (maxReach >= nums.length - 1) {
          return true;                           // If we can reach the last index
      }
  }

  return true;                                   //If we can reach the last index (this line should not be reached)
}


console.log(fun()); 
`.trim();

const containsDuplicate = `
function containsDuplicate(nums){
  const map = {}

  for (num of nums) {
    if (map[num]) {
      return true
    }
    map[num] = 1
  }
  return false
}

console.log(containsDuplicate([1,2,3,1]))
`.trim();

const summaryRanges = `
function summaryRanges(nums) {
  let start = null
  const result = []

  for (let i=0; i<nums.length; i++) {
    if (start === null) {
      start = nums[i]
    }
    if (nums[i] === nums[i + 1] - 1) continue;

    if (nums[i] === start) {
      result.push(nums[i].toString())
      start = null
    } 
    else {
      result.push('$'{start}->'$'{nums[i]}')
      start = null
    }
  }

  return result
}

console.log(summaryRanges([1,2,3,4,6,7,9]))
`.trim();

const productExceptSelf = `
function fun() {
  const arr = [1, 2, 3, 4];
  const result = [];

  for (let i = 0; i < arr.length; i++) {
    let prod = 1;
    for (let j = 0; j < arr.length; j++) {
      if (arr[i]!==arr[j]) {
        prod *= arr[j];
      }
    }
    result.push(prod); 
    console.log(prod);
  }
}

fun();
`.trim();

const countSmaller = `
function fun(){
  const arr = [5,2,6,1];
  const result = arr.map(() => 0);

  for(let i=0;i<arr.length;i++){
    for(let j=(i+1);j<arr.length;j++){
      if(arr[i]>arr[j]){
        result[i] +=1;
      }
    }
  }
  console.log(result)
}

fun()
`.trim();

const replaceNum = `
function fun(){
  const arr=[1,2,3,5,4];
